import { Link } from 'react-router-dom'
import Logo from '../../assets/img/Logo.png';
import './Menu.css';
import Button from '../Button'

function Menu() {
    return (
        <nav className="Menu">
            <a href="/">
                <img className="Logo" src={Logo} alt="Hello Wordflix logo" />
            </a>

            <Button as="a" className="ButtonLink" href="/">
                Novo v√≠deo
            </Button>
        </nav>
    );
}

export default Menu;
